import React from 'react';
import myPicture from '../img/mypicture.jpeg'
import '../styles/about.css'

class About extends React.Component {


	render(){
        return (


<div>
    <h1>Test</h1>
    <img
			className={"img-fluid " + this.props.fadeIn}
			src={myPicture}
			alt=""
			style={{
					borderRadius: 50 + "%",
					height: 300 + "px",
					width: 300 + "px"
					}}
	/>
</div>








            );
        }
     };
    export default About;
